<!-- Modal -->
<ng-template #modal let-modal>
  <div class="modal-header p-2">
    <h3 class="modal-title">Village Details</h3>
    <button type="button" class="close text-danger p-2" aria-label="Close" (click)="modal.dismiss('Cross click')">
      <span aria-hidden="true">&times;</span>
    </button>
  </div>

  <div class="modal-body p-2">
    <table mat-table [dataSource]="villageDetails" class="mat-elevation-z8">
      <ng-container matColumnDef="field">
        <th mat-header-cell *matHeaderCellDef> Field </th>
        <td mat-cell *matCellDef="let element"> {{ element.field }} </td>
      </ng-container>

      <ng-container matColumnDef="value">
        <th mat-header-cell *matHeaderCellDef> Value </th>
        <td mat-cell *matCellDef="let element"> {{ element.value }} </td>
      </ng-container>

      <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
      <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
    </table>
  </div>

  <div class="modal-footer">
    <button type="button" class="btn btn-primary" (click)="navigateToVillageDetails(modal)">
      Read More
    </button>
  </div>
</ng-template>
